INSERT INTO `application_status` (`id`, `terms`, `general_instructions`, `receive_app_for`, `status`) VALUES
(1, '                                            <ul>\n       <li>Students Aadhaar Card Copy</li>\n       <li>Parents Aadhaar Card copy</li>\n       <li>Students last academic years marksheet/result copy showing achieved minimum 60% marks</li>\n       <li>Parents Income Certificate duly signed by employer/Tax Challan</li>\n       <li>Last month electricity bill copy</li>\n       <li>School Bank Details (Account Name, Account Number, Bank Name, IFSC Code)</li>\n       <li>Annual school fee particulars given by school and copy of school fee paid receipt of the first month/term for Academic year 2018-19</li>\n       <li><b>Courier it to -:</b><br>\n        <b>HM Charitable Trust</b><br>\n        42, Navketan Industrial Estate, Mahakali Caves Road, Andheri (East), Mumbai - 400093\n       </li>\n      </ul>\n  \n  \n  \n  ', '                    <ul class=\"susscesspage\">\n  <li>Only Student studying in class 1 to class 15 are eligible for freeship.</li>\n &lt;!--  <li>Freeship is awarded to  students who have successfully passed the previous year with minimum 60%  or more marks.</li> --&gt;\n <li>Freeship is awarded to students who have successfully passed the previous year.</li>\n  <li>Freeship cheque will be issued only in the name of the school / Education Trust</li>\n  <li>It is compulsory to send all documents (nos. 1 - 7) to above address, before 15th July 2018</li>\n  <li>Incomplete application hm_apps or hm_apps with incorrect data will be rejected</li>\n  <li>Application for the <b>Freeship will be open from 15th May till 30th June - 2018.</b></li>\n  <li>Acceptance / Rejection of an Application for Freeship is at the sole discretion of the trustees.</li>\n  <li>Multiple applications submitted by the same student will be result disqualification.</li>\n&lt;!--   <li>Freeship will be limited to Rs.8000 to Rs. 8500 per Student OR Rs.15000 to Rs. 16000 in case of a family with more than one Applicant</li> --&gt;\n<li>Freeship will be limited to Rs.10000  per Student or 12 months tuition fees which ever is lower or Rs.20000 in case of a family with more than one Appli</li>\n</ul>\n  \n  \n  \n  \n  ', 2018, 1);
